class Solution
{
    public function findMaxConsecutiveOnes($nums)
    {
        $max = 0;
        $current = 0;

        foreach ($nums as $n) {
            if ($n == 0) {
                if ($current > $max) {
                    $max = $current;
                }
                $current = 0;
            } else {
                $current++;
            }

        }
        if ($current > $max) {
            $max = $current;
            $current = 0;
        }
        return $max;
    }
}

